import React from 'react'
import { ProductItem } from './ProductItem'

export const Products = () => {
  const numbers = [1, 2, 3, 4, 5];
  const listItems = numbers.map((numbers) => 
    <ProductItem key={numbers}/>

  );
  return (
    <div className="content">
      {listItems}
    </div>
  )
}
